window.bookSummaryJSON = "<p>Some creatures are fatally flawed. I'm a thrill-seeker, a gambler, and a thief—playing whim to my greed. However, my sins aren't what I have to fight right now...it's theirs.</p> <p>Three men deemed too powerful and wrong to let live by our Council. They're too devious, too strong, too evil. An unhinged crazy incubus, an obsessive shape-shifting beast, and the Dullahan himself—scars, steed, and all.</p> <p>Tricked, captured, captive. They plan to use my power and wield it as their own. I'm their golden ticket, their pot of gold. Kings, gods, and creatures have tried to use my kind, and these three monsters are exactly the same. They know that when luck is on your side, the odds are never even.</p> <p>There's an unstoppable hitman on their back, and they need something that gives them the upper hand, a guarantee of success. And that something is me.</p> <p>Author notes: This is a stand-alone urban fantasy romance with lots of love all around.</p>"; 
